ഒരു ചതുരശ്രാകൃതിയിലുള്ള മൈതാനം, താഴെ കാണിച്ചിരിക്കുന്നതുപോലെ, ഒരു കായിക പാതയിൽ അടച്ചിരിക്കുന്നു. പാതയിൽ മൈതാനത്തിന്റെ രണ്ട് വശങ്ങളും രണ്ട് അർദ്ധവൃത്തങ്ങളും ഉൾപ്പെടുന്നു. പാതയുടെ നീളം 400 മീറ്റർ ആണ്. മൈതാനത്തിന്റെ ഏറ്റവും വലിയ സാധ്യതയുള്ള വിസ്തീർണം എത്ര ചതുരശ്ര മീറ്റർ ആണ്?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

